import EffectUse from "./components/EffectUse";
import Form from "./components/Form";
function App() {
  return (
    <>
      <Navbar name="TextifyMe" aboutT="About" Contact="Contact us"/>
      <div className="container my-4">
       <EffectUse/>
      <Form head="Enter a Sentence "/>
      </div>
    </>
  );
}

export default App;
